import React from 'react';
import PropTypes from 'prop-types';


const ControlsItem = ({ text }) => {
         return(
             <div>
                 { text }
             </div>
         );
}

ControlsItem.propTypes = {
    text: PropTypes.string,
};

ControlsItem.defaultProps = {
    text: "hello world",
};

export default ControlsItem;
